[384135] = {name = "Rune of Fortune", additional_info = "Instant\n[q]Grants all raid members the chance to discover additional rewards from Kel'Thuzad and his lieutenants.\n\n This effect stacks and lasts for an entire week."},
[398061] = {name = "Bracers of Redirection", additional_info = "[q]Gain 1 combo point whenever you avoid any attack or spell from an enemy target that is not your current target.\n(1s cooldown)"},
[398115] = {name = "Inoculation Belt", additional_info = "Instant\n[q]Take 1% damage to remove a disease or poison effect from yourself."},
[398117] = {name = "Pockets of Treats", additional_info = "20 yd range\nInstant\n[q]Open the bag of treats and palm it into your target's pocket, increasing the damage of Beasts against this target by 20."},
[398196] = {name = "Quick Draw", additional_info = "{25 Energy} {20 yd range}\n{Instant} {10 sec cooldown}\nRequires Ranged Weapon\n[q]Draw your ranged weapon and fire a quick shot at an enemy, causing normal ranged weapon damage and reducing the target's movement speed by 50% for 6 sec. Awards 1 combo point.\n\n Quick Draw benefits from all talents and effects that trigger from or modify Sinister Strike."},
[398197] = {name = "Quick Draw", additional_info = "[q]Gain the Quick Draw ability:\n\n\nDraw your ranged weapon and fire a quick shot at an enemy, causing normal ranged weapon damage and reducing the target's movement speed by 50% for 6 sec. Awards 1 combo point.\n\n Quick Draw benefits from all talents and effects that trigger from or modify Sinister Strike."},
[398198] = {name = "Storm of Swords", additional_info = "{20 Energy} {100 yd range}\nInstant\n[q]Finishing move that increases parry chance. Lasts longer and increases parry chance per combo point:\n 1 point : 10 seconds, 12% Parry\n 2 points: 15 seconds, 14% Parry\n 3 points: 20 seconds, 16% Parry\n 4 points: 25 seconds, 18% Parry\n 5 points: 30 seconds, 20% Parry"},
[398199] = {name = "Hubris Tunic", additional_info = nil},
[398538] = {name = "Runecarve Bracer - Minor Deflect", additional_info = "5 sec cast\nRequires Bracers\nTools:\nRuned Copper Rod\nReagents:\nLesser Magic Essence , Strange Dust\n[q]Permanently enchant bracers so that the defense skill of the wearer is increased by 1."},
[398603] = {name = "Runecarving", additional_info = "Instant\n[q]Affix powerful runes to your armor."},
[398604] = {name = "Runecarving", additional_info = nil},
[399954] = {name = "Chest Rune Ability", additional_info = "Instant\n[q]Equip a Chest slot item with a Rune engraved to activate an ability in this slot."},
[399956] = {name = "Mutilate", additional_info = "{40 Energy} {Melee Range}\nInstant\n[q]Instantly attacks with both weapons for 100% weapon damage plus an additional [100 / 100 * (5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60)] with each weapon. Damage is increased by 20% against Poisoned targets. Awards 2 combo points.\n\n Mutilate benefits from all talents and effects that trigger from or modify Backstab unless otherwise specified."},
[399960] = {name = "Mutilate", additional_info = "Melee Range\nInstant\n[q]Instantly attacks with both weapons for 100% weapon damage plus additional [100 / 100 * (5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60)] with each weapon. Damage is increased by 20% against Poisoned targets. Awards 2 combo points."},
[399961] = {name = "Mutilate", additional_info = "Melee Range\nInstant\n[q]Instantly attacks with both weapons for 100% weapon damage plus additional $[100 / 100 * (5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60)] with each weapon. Damage is increased by 20% against Poisoned targets. Awards 2 combo points."},
[399962] = {name = "Mutilate", additional_info = "[q]Gain the Mutilate ability:\n\n\n Instantly attacks with both weapons for 100% weapon damage plus an additional [100 / 100 * (5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60)] with each weapon. Damage is increased by 20% against Poisoned targets. Awards 2 combo points.\n\n Mutilate benefits from all talents and effects that trigger from or modify Backstab unless otherwise specified."},
[399963] = {name = "Envenom", additional_info = "{35 Energy} {Melee Range}\nInstant\nRequires Melee Weapon\n[q]Finishing move that deals instant poison damage based on your Deadly Poison doses on the target. Following the Envenom attack you have a 75% increased frequency of applying Instant Poison for 1 sec plus an additional 1 sec per combo point. One dose is activated per combo point:\n 1 dose: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 1 + Attack power * 0.09] damage\n 2 doses: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 2 + Attack power * 0.18] damage\n 3 doses: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 3 + Attack power * 0.27] damage\n 4 doses: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 4 + Attack power * 0.36] damage\n 5 doses: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 5 + Attack power * 0.45] damage"},
[399965] = {name = "Deadly Brew", additional_info = "[q]Grants several improvements to your poisons:\n\n When you inflict any other poison on a target, you also inflict Deadly Poison.\n\n If your weapon does not have a poison applied, it has a chance to trigger Instant Poison as if Instant Poison were applied.\n\n Deadly Poison and Instant Poison now gain increased damage from your Attack Power."},
[399966] = {name = "Legs Rune Ability", additional_info = "Instant\n[q]Equip a Legs slot item with a Rune engraved to activate an ability in this slot."},
