[399985] = {name = "Shadowstrike", additional_info = "{20 Energy} {25 yd range}\nInstant\nRequires Melee Weapon\nRequires Stealth\n[q]Teleport behind your target and strike, causing 150% weapon damage to the target. Must be stealthed. Awards 1 combo point."},
