[400012] = {name = "Blade Dance", additional_info = "{25 Energy} {100 yd range}\nInstant\n[q]Finishing move that increases your Parry chance by 10%. Lasts longer per combo point:\n\n 1 point : 14 seconds\n 2 points: 18 seconds\n 3 points: 22 seconds\n 4 points: 26 seconds\n 5 points: 30 seconds"},
