[400574] = {name = "Arcane Blast", additional_info = "{7% of base mana} {30 yd range}\n2.5 sec cast\n[q]Blasts the target with energy, dealing [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 453 / 100] to [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 527 / 100] Arcane damage. Each time you cast Arcane Blast, the damage and healing of all other Arcane spells is increased by 15% and mana cost of Arcane Blast is increased by 175%. Effect stacks up to 4 times and lasts 6 sec or until any other Arcane damage or healing spell is cast."},
