[403925] = {name = "Engrave Gloves - Chaos Bolt", additional_info = "3 sec cast\nRequires Gloves\n[q]Engrave your gloves with the Chaos Bolt rune:\n\n\nSends a bolt of chaotic fire at the enemy, dealing [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 522 / 100] to [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 662 / 100] Fire damage. Chaos Bolt always hits, cannot be resisted, and its knowledge causes all your Fire spells to pierce through absorption effects. Chaos Bolt gains a high chance to be resisted when used against monsters 4 or more levels above your level."},
[403932] = {name = "Engrave Chest - Master Channeler", additional_info = "3 sec cast\nRequires Chest, Chest\n[q]Engrave your chest or robe with the Master Channeler rune:\n\n\nYour Drain Life is no longer channeled, lasts 15 sec with a 15 sec cooldown, costs 100% more mana, and heals you for 50% more each time it deals damage."},
[403936] = {name = "Engrave Gloves - Shadow Bolt Volley", additional_info = "3 sec cast\nRequires Gloves\n[q]Engrave your gloves with the Shadow Bolt Volley rune:\n\n\nYour Shadow Bolt now strikes up to 5 targets within a chain distance of 10 yards, but for 20% reduced damage."},
[403937] = {name = "Engrave Chest - Lake of Fire", additional_info = "3 sec cast\nRequires Chest, Chest\n[q]Engrave your chest or robe with the Lake of Fire rune:\n\n\nRain of Fire also leaves a Lake of Fire on the ground after you channel it for its full duration that increases all Fire damage you deal and your Demon pet deals to affected enemies by 50% for 15 sec."},
[403938] = {name = "Engrave Gloves - Metamorphosis", additional_info = "3 sec cast\nRequires Gloves\n[q]Engrave your gloves with the Metamorphosis rune:\n\n\nTransform into a Demon, increasing Armor by 500%, reducing the chance you will be critically hit by 6%, increasing your threat by 50%, increasing mana gained from Life Tap by 100%, transforming the functionality of some of your abilities, and granting some new abilities:\n\n Searing Pain: Now instant.\n\n Shadow Bolt: Becomes Shadow Cleave, a Shadow melee attack that hits up to 3 nearby enemies, but has a 6 sec cooldown.\n\n Fear: Replaced with Menace.\n\n\nTaunts the target to attack you, but has no effect if the target is already attacking you.\n\n Demon Charge\n\n\nCharge an enemy and stun it for 1 sec. Cannot be used in combat.\n\n Demonic Howl\n\n\nForces all nearby enemies to focus attacks on you for 6 sec."},
