[407798] = {name = "Seal of Martyrdom", additional_info = "4% of base mana\nInstant\n[q]Fills you with holy spirit for 30 sec, causing each of your melee attacks to deal 50% weapon damage to your target, but you lose health equal to 10% of the damage inflicted. While this seal is active, your party and raid members within 40 yards each gain mana equal to 133% of damage you take from this seal.\n\n Unleashing this Seal's energy will judge an enemy, instantly causing 85% weapon damage at the cost of health equal to 10% of the damage inflicted.\n\n This ability's Seal and Judgement benefit from talents and effects that modify the Seal or Judgement of Seal of Righteousness."},
