[408484] = {name = "Chain Lightning", additional_info = "30 yd range\nInstant\n[q]Hurls a lightning bolt at the enemy, dealing 252 to 283 Nature damage and then jumping to additional nearby enemies. Each jump reduces the damage by 30%. Affects 3 total targets."},
[408490] = {name = "Lava Burst", additional_info = "{10% of base mana} {30 yd range}\n{2 sec cast} {8 sec cooldown}\n[q]You hurl molten lava at the target, dealing [469 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] to [605 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] Fire damage. If your Flame Shock is on the target, Lava Burst will deal a critical strike."},
[408491] = {name = "Lava Burst", additional_info = "30 yd range\nInstant\n[q]You hurl molten lava at the target, dealing [234 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] to [303 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] Fire damage. If your Flame Shock is on the target, Lava Burst will deal a critical strike."},
[408496] = {name = "Dual Wield Specialization", additional_info = "[q]Increases your chance to hit with both spells and melee attacks by 10% while dual wielding, your Stormstrike ability now hits with both weapons while dual wielding, and increases the damage done by your offhand weapon by 50%."},
[408498] = {name = "Maelstrom Weapon", additional_info = "[q]When you deal damage with a melee attack, you have a chance to reduce the cast time and mana cost of your next Lightning Bolt, Chain Lightning, Lesser Healing Wave, Healing Wave, Chain Heal, or Lava Burst spell by 20%. Chance increased by 50% while your main hand weapon is enchanted with Windfury Weapon. Stacks up to 5 times. Lasts 30 sec."},
[408501] = {name = "Maelstrom Ready!", additional_info = nil},
[408505] = {name = "Maelstrom Weapon", additional_info = "Instant\n[q]Reduces the cast time and mana cost of your next Lightning Bolt, Chain Lightning, Lesser Healing Wave, Healing Wave, or Chain Heal spell by 20%."},
[408507] = {name = "Lava Lash", additional_info = "{1% of base mana} {Melee Range}\n{Instant} {6 sec cooldown}\nRequires Melee Weapon\n[q]You charge your off-hand weapon with lava, instantly dealing 100% off-hand Weapon damage. Damage is increased by 125% if your off-hand weapon is enchanted with Flametongue."},
[408510] = {name = "Water Shield", additional_info = "Instant\n[q]The caster is surrounded by 3 globes of water, granting 1% of your maximum mana per 5 sec. When a spell, melee or ranged attack hits the caster, 4% of maximum mana is restored to the caster. This expends one water globe. Only one globe will activate every few seconds. Lasts 10 min. Only one Elemental Shield can be active on the Shaman at any one time.\n(3.5s cooldown)"},
[408511] = {name = "Water Shield", additional_info = "Instant\n[q]Gaining mana when hit while Water Shield is active."},
[408514] = {name = "Earth Shield", additional_info = "{5% of base mana} {40 yd range}\nInstant\n[q]Protects the target with an earthen shield, reducing casting or channeling time lost when damaged by 30% and causing attacks to heal the shielded target for [55 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) / 100]. This effect can only occur once every few seconds. 9 charges. Lasts 10 min. Earth Shield can only be placed on one target at a time and only one Elemental Shield can be active on a target at a time.\n(3.5s cooldown)"},
[408519] = {name = "Earth Shield", additional_info = "Unlimited range\nInstant\n[q]Healed by Earth Shield."},
[408521] = {name = "Riptide", additional_info = "{18% of base mana} {40 yd range}\n{Instant} {6 sec cooldown}\n[q]Heals a friendly target for [113 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] to [123 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] and another [5 * 24 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] over 15 sec. Your next Chain Heal cast on that primary target within 15 sec will consume the healing over time effect and increase the amount of the Chain Heal by 25%. This spell also triggers Ancestral Awakening."},
[408524] = {name = "Shield Mastery", additional_info = "[q]Each time you Block, you regenerate mana equal to 8% of your maximum mana and you gain Armor equal to 30% of your shield's armor value, stacking up to 5 times. You also always gain 10% increased chance to Block and 15% increased Block value."},
[408525] = {name = "Shield Mastery", additional_info = "Instant\n[q]Increases armor by 30% of your shield's Armor value for 15 sec, stacking up to 5 times."},
[408531] = {name = "Way of Earth", additional_info = "[q]While Rockbiter Weapon is active on your main hand weapon and you have a shield equipped, you deal 50% increased threat, gain 30% increased health, take 10% reduced damage, gain 6% reduced chance to be critically hit by melee attacks, and Earth Shock taunts targets to attack you and has a separate cooldown from other Shock spells but has its range reduced to melee range."},
[408680] = {name = "Way of Earth", additional_info = "Instant\n[q]While Rockbiter Weapon is active on your main hand weapon, you deal 50% increased threat, gain 30% increased health, take 10% reduced damage, gain 6% reduced chance to be critically hit by melee attacks, and Earth Shock taunts targets to attack you and has a separate cooldown from other Shock spells."},
[408681] = {name = "Earth Shock", additional_info = "{30 Mana} {Melee Range}\n{Instant} {6 sec cooldown}\n[q]Instantly shocks the target with concussive force, causing 19 to 22 Nature damage. It also interrupts spellcasting and prevents any spell in that school from being cast for 2 sec. Causes a high amount of threat and taunts the target."},
[408683] = {name = "Earth Shock", additional_info = "{50 Mana} {Melee Range}\n{Instant} {6 sec cooldown}\n[q]Instantly shocks the target with concussive force, causing 35 to 38 Nature damage. It also interrupts spellcasting and prevents any spell in that school from being cast for 2 sec. Causes a high amount of threat and taunts the target."},
[408685] = {name = "Earth Shock", additional_info = "{85 Mana} {Melee Range}\n{Instant} {6 sec cooldown}\n[q]Instantly shocks the target with concussive force, causing 65 to 69 Nature damage. It also interrupts spellcasting and prevents any spell in that school from being cast for 2 sec. Causes a high amount of threat and taunts the target."},
