[408696] = {name = "Spirit of the Alpha", additional_info = "{8% of base mana} {30 yd range}\nInstant\n[q]Infuses the target with the spirit of an alpha wolf, increasing all threat generated by the target by 45% for 30 min. Limit 1 target. If cast on a target other than self, the Shaman also gains Loyal Beta, increasing Physical damage done by 5% and reducing all threat generated by 30% for 30 min. A target cannot have both Spirit of the Alpha and Loyal Beta at the same time."},
