[409433] = {name = "Chimera Shot", additional_info = "{6% of base mana} {8 - 35 yd range}\n6 sec cooldown\nRequires Ranged Weapon\n[q]You deal 135% weapon damage, refreshing the current Sting on your target and triggering an effect:\n\n Serpent Sting - Instantly deals 48% of the damage done by your Serpent Sting.\n\n Viper Sting - Instantly restores mana to you equal to 60% of the total amount drained by your Viper Sting.\n\n Scorpid Sting - Attempts to Disarm the target for 10 sec. This effect cannot occur more than once per 1 minute."},
