[409510] = {name = "Freezing Trap", additional_info = "{50 Mana} {35 yd range}\n{Instant} {15 sec cooldown}\n[q]Place a frost trap at a nearby location that freezes the first enemy that approaches, preventing all action for up to 10 sec. Any damage caused will break the ice. Trap will exist for 1 min. Only one trap can be active at a time."},
[409512] = {name = "Freezing Trap", additional_info = "{75 Mana} {35 yd range}\n{Instant} {15 sec cooldown}\n[q]Place a frost trap at a nearby location that freezes the first enemy that approaches, preventing all action for up to 15 sec. Any damage caused will break the ice. Trap will exist for 1 min. Only one trap can be active at a time."},
[409519] = {name = "Freezing Trap", additional_info = "{100 Mana} {35 yd range}\n{Instant} {15 sec cooldown}\n[q]Place a frost trap at a nearby location that freezes the first enemy that approaches, preventing all action for up to 20 sec. Any damage caused will break the ice. Trap will exist for 1 min. Only one trap can be active at a time."},
[409520] = {name = "Frost Trap", additional_info = "{60 Mana} {35 yd range}\n{Instant} {15 sec cooldown}\n[q]Place a frost trap at a nearby location that creates an ice slick around itself for 30 sec when the first enemy approaches it. All enemies within 10 yards will be slowed by 60% while in the area of effect. Trap will exist for 1 min. Only one trap can be active at a time."},
[409521] = {name = "Immolation Trap", additional_info = "{50 Mana} {35 yd range}\n{Instant} {15 sec cooldown}\n[q]Place a fire trap at a nearby location that will burn the first enemy to approach for 105 Fire damage over 15 sec. Trap will exist for 1 min. Only one trap can be active at a time."},
