[409528] = {name = "Immolation Trap", additional_info = "{190 Mana} {35 yd range}\n{Instant} {15 sec cooldown}\n[q]Place a fire trap at a nearby location that will burn the first enemy to approach for 510 Fire damage over 15 sec. Trap will exist for 1 min. Only one trap can be active at a time."},
[409530] = {name = "Immolation Trap", additional_info = "{245 Mana} {35 yd range}\n{Instant} {15 sec cooldown}\n[q]Place a fire trap at a nearby location that will burn the first enemy to approach for 690 Fire damage over 15 sec. Trap will exist for 1 min. Only one trap can be active at a time."},
[409532] = {name = "Explosive Trap", additional_info = "{275 Mana} {35 yd range}\n{Instant} {15 sec cooldown}\n[q]Place a fire trap at a nearby location that explodes when an enemy approaches, causing 104 to 135 Fire damage and 150 additional Fire damage over 20 sec to all within 10 yards. Trap will exist for 1 min. Only one trap can be active at a time."},
[409534] = {name = "Explosive Trap", additional_info = "{395 Mana} {35 yd range}\n{Instant} {15 sec cooldown}\n[q]Place a fire trap at a nearby location that explodes when an enemy approaches, causing 145 to 193 Fire damage and 240 additional Fire damage over 20 sec to all within 10 yards. Trap will exist for 1 min. Only one trap can be active at a time."},
[409535] = {name = "Explosive Trap", additional_info = "{520 Mana} {35 yd range}\n{Instant} {15 sec cooldown}\n[q]Place a fire trap at a nearby location that explodes when an enemy approaches, causing 208 to 265 Fire damage and 330 additional Fire damage over 20 sec to all within 10 yards. Trap will exist for 1 min. Only one trap can be active at a time."},
[409541] = {name = "Trap Launcher", additional_info = "[q]Your Traps can now be placed at any location within 35 yards, and can be placed while you are in combat. Additionally, your Fire-based and Frost-based traps now have separate shared cooldowns."},
[409552] = {name = "Explosive Shot", additional_info = "{3.5% of base mana} {8 - 35 yd range}\n6 sec cooldown\nRequires Ranged Weapon\n[q]You fire an explosive charge into the enemy target, dealing [Ranged attack power * 0.039 + 62 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)]-[Ranged attack power * 0.039 + 94 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] Fire damage to all enemies within 8 yards. The charge will deal damage again every second for an additional 2 sec."},
[409554] = {name = "Explosive Shot", additional_info = "Unlimited range\n[q]You fire an explosive charge into the enemy target, dealing (Ranged attack power * 0.14 + 10)-(Ranged attack power * 0.14 + 10) Fire damage. The charge will blast the target every second for an additional until cancelled. Cooldown shared with Arcane Shot."},
[409580] = {name = "Heart of the Lion", additional_info = "8% of base mana\nInstant\n[q]The hunter invokes the heart of a lion, increasing total stats by 10% for all nearby allies, and increasing total stats for the Hunter by an additional 10%."},
