[409805] = {name = "Wild Strikes", additional_info = "[q]Gain the Wild Strikes ability:\n\n\nWhile you are in Cat Form, Bear Form, or Dire Bear Form, party members within 20 yards gain increased combat ferocity. Each melee hit has a 20% chance of granting the attacker an extra attack with 20% additional Attack Power. No effect if the party member is already benefitting from Windfury Totem."},
[409809] = {name = "Survival Instincts", additional_info = "[q]Gain the Survival Instincts ability:\n\n\nWhen activated, this grants you 30% of your maximum health for 20 sec. After the effect expires, the health is lost. Useable in any form.\n\n In addition, you regenerate 5 rage every time you dodge while in Bear Form or Dire Bear Form, 10 energy while in Cat Form, or 1% of your maximum mana while in any other form."},
[409810] = {name = "Wild Growth", additional_info = "[q]Gain the Wild Growth ability:\n\n\nHeals all of target player's party members within 40 yards of target player for [34 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] over 7 sec. The amount healed is applied quickly at first, and slows down as Wild Growth reaches its full duration."},
[409813] = {name = "Eclipse", additional_info = "[q]Gain the Eclipse ability:\n\n\nStarfire increases the critical strike chance of your next two Wraths by 30%, and Wrath reduces the cast time of your next Starfire by 1.0 sec, both effects stacking up to 4 charges. Both spells also gain 70% chance at all times to not lose casting time when you take damage."},
[409819] = {name = "Savage Roar", additional_info = "[q]Gain the Savage Roar ability:\n\n\nFinishing move that increases physical damage done by 30% while in Cat Form. Lasts longer per combo point:\n 1 point : 14 seconds\n 2 points: 19 seconds\n 3 points: 24 seconds\n 4 points: 29 seconds\n 5 points: 34 seconds"},
[409824] = {name = "Lifebloom", additional_info = "[q]Reduces the global cooldown on your Rejuvenation and Lifebloom abilities by 0.5 sec and you gain the Lifebloom ability:\n\n\nHeals the target for [4 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] over 7 sec. When Lifebloom completes its duration or is dispelled, the target instantly heals for [57 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] and the Druid regains half the cost of the spell. This effect can stack up to 3 times on the same target."},
[409826] = {name = "Nature's Fury", additional_info = "[q]Gain the Nature's Fury ability:\n\n\nIncreases your healing power by 90% of your Nature spell damage for 30 sec."},
[409828] = {name = "Mangle", additional_info = "[q]Gain the Mangle (Bear) ability and replace your Claw ability with Mangle (Cat). This ability benefits from and triggers all effects associated with Claw and Maul.\n\n\nMangle the target for 160% normal damage and cause the target to take 30% additional damage from Bleed effects and Shred for 1 min. This ability benefits from and triggers all effects associated with Claw and Maul.\n\n\nMangle the target for 270% normal damage and cause the target to take 30% additional damage from Bleed effects and Shred for 1 min. Awards 1 combo point. This ability benefits from and triggers all effects associated with Claw and Maul."},
[409830] = {name = "Nourish", additional_info = "[q]Gain the Nourish ability:\n\n\nHeals a friendly target for [161 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] to [189 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)]. Heals for an additional 20% if you have a Rejuvenation, Regrowth, Lifebloom, or Wild Growth effect active on the target. This spell benefits from and triggers all effects associated with Healing Touch."},
[409831] = {name = "Dreamstate", additional_info = "[q]Gain the Dreamstate ability:\n\n\nYour damaging spell critical strikes grant you 50% of your mana regeneration while casting for 8 sec and increase Nature damage dealt to the target by 20% for 12 sec."},
[409832] = {name = "Fury of Stormrage", additional_info = "[q]Gain the Fury of Stormrage ability:\n\n\nReduces the mana cost of Wrath by 100% and each time you deal damage with Wrath you have a 12% chance for your next cast of Healing Touch within 15 sec to be instant and castable in any shapeshift form."},
[409856] = {name = "Spirit Ritual", additional_info = "30 yd range\nChanneled (10 min cast)\n[q]Begins a ritual to free the spirit of a fallen adventurer."},
[409858] = {name = "Dummy Trigger", additional_info = nil},
[409906] = {name = "Beacon of Light", additional_info = "[q]Gain the Beacon of Light ability:\n\n\nThe target becomes a Beacon of Light to all members of your party or raid within a 40 yard radius. Any heals you cast on party or raid members will also heal the Beacon for 100% of the amount healed. Only one target can be the Beacon of Light at a time. Lasts 1 min."},
[409911] = {name = "Hand of Reckoning", additional_info = "[q]Gain the Hand of Reckoning ability:\n\n\nTaunts the target to attack you, but has no effect if the target is already attacking you.\n\n While you know this ability, the threat bonus from Righteous Fury is increased to 80% and Righteous Fury causes you to gain mana when healed by others equal to 25% of the amount healed. Additionally, while Righteous Fury is active, damage which takes you below 35% health is reduced by 20%. Righteous Fury will remain active until cancelled."},
[409914] = {name = "Crusader Strike", additional_info = "[q]Gain the Crusader Strike ability:\n\n\nAn instant strike that causes 75% weapon damage as Holy and regenerates 5% of your maximum mana. The duration of all Judgement effects on the target is refreshed to 30 sec."},
[409918] = {name = "Inspiration (Judgement)", additional_info = nil},
[409920] = {name = "Learn Relic (Judgement)", additional_info = nil},
[409922] = {name = "Hammer of the Righteous", additional_info = "[q]Gain the Hammer of the Righteous ability:\n\n\nHammer the current target and up to 2 additional nearby targets, causing 4 times your main hand damage per second as Holy damage."},
[409924] = {name = "Divine Storm", additional_info = "[q]Gain the Divine Storm ability:\n\n\nAn instant weapon attack that causes 110% of weapon damage to up to 4 enemies within 8 yards. The Divine Storm heals up to 3 party or raid members totaling 25% of the damage caused."},
[409925] = {name = "Seal of Martyrdom", additional_info = "[q]Gain the Seal of Martyrdom ability:\n\n\nFills you with holy spirit for 30 sec, causing each of your melee attacks to deal 50% weapon damage to your target, but you lose health equal to 10% of the damage inflicted. While this seal is active, your party and raid members within 40 yards each gain mana equal to 133% of damage you take from this seal.\n\n Unleashing this Seal's energy will judge an enemy, instantly causing 85% weapon damage at the cost of health equal to 10% of the damage inflicted.\n\n This ability's Seal and Judgement benefit from talents and effects that modify the Seal or Judgement of Seal of Righteousness."},
[409930] = {name = "Libram of Judgement", additional_info = nil},
[409933] = {name = "Avenger's Shield", additional_info = "[q]Gain the Avenger's Shield ability:\n\n\nHurls a holy shield at the enemy, dealing [366 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] to [448 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] Holy damage, Dazing them and then jumping to additional nearby enemies. Affects 3 total targets. Lasts 10 sec."},
[409935] = {name = "Divine Sacrifice", additional_info = "[q]Gain the Divine Sacrifice ability:\n\n\n30% of all damage taken by party members within 30 yards is redirected to the Paladin for 10 sec. Damage which reduces the Paladin below 20% health will break the effect and grant the paladin 10% increased damage and healing done for 10 sec. Divine Sacrifice cannot be used while you are under the effects of Blessing of Protection, Divine Shield, or Divine Protection, and prevents you from being targeted by those abilities while it is active."},
[409936] = {name = "Inspiration Exemplar", additional_info = "[q]Gain the Inspiration Exemplar\n ability:\n\n\nYour inspiring presence periodically dispels Fear and Sleep effects on nearby party members."},
[409938] = {name = "Fire Nova", additional_info = "[q]Gain the Fire Nova ability, replacing your Fire Nova Totem:\n\n\nYour Fire Nova Totem spell is replaced with Fire Nova, which causes your current Fire totem to emit damage at its location."},
[409940] = {name = "Dual Wield Specialization", additional_info = "[q]Gain the Dual Wield Specialization ability:\n\n\nIncreases your chance to hit with both spells and melee attacks by 10% while dual wielding, your Stormstrike ability now hits with both weapons while dual wielding, and increases the damage done by your offhand weapon by 50%."},
[409941] = {name = "Water Shield", additional_info = "[q]Gain the Water Shield ability:\n\n\nThe caster is surrounded by 3 globes of water, granting 1% of your maximum mana per 5 sec. When a spell, melee or ranged attack hits the caster, 4% of maximum mana is restored to the caster. This expends one water globe. Only one globe will activate every few seconds. Lasts 10 min. Only one Elemental Shield can be active on the Shaman at any one time."},
[409943] = {name = "Shield Mastery", additional_info = "[q]Gain the Shield Mastery ability:\n\n\nEach time you Block, you regenerate mana equal to 8% of your maximum mana and you gain Armor equal to 30% of your shield's armor value, stacking up to 5 times. You also always gain 10% increased chance to Block and 15% increased Block value."},
[409944] = {name = "Ancestral Guidance", additional_info = "[q]Gain the Ancestral Guidance ability:\n\n\nFor the next 10 sec, 25% of your damage is converted to healing on up to 3 nearby party members, and 100% of your healing is converted to damage on your most recent Flame Shock target."},
[409945] = {name = "Overload", additional_info = "[q]Gain the Overload ability:\n\n\nGives your Lightning Bolt, Chain Lightning, Chain Heal, Healing Wave, and Lava Burst spells a 50% chance to cast a second, similar spell on the same target at no additional cost that causes half damage or healing and no threat."},
[409946] = {name = "Maelstrom Weapon", additional_info = "[q]Gain the Maelstrom Weapon ability:\n\n\nWhen you deal damage with a melee attack, you have a chance to reduce the cast time and mana cost of your next Lightning Bolt, Chain Lightning, Lesser Healing Wave, Healing Wave, Chain Heal, or Lava Burst spell by 20%. Chance increased by 50% while your main hand weapon is enchanted with Windfury Weapon. Stacks up to 5 times. Lasts 30 sec."},
[409947] = {name = "Earth Shield", additional_info = "[q]Gain the Earth Shield ability:\n\n\nProtects the target with an earthen shield, reducing casting or channeling time lost when damaged by 30% and causing attacks to heal the shielded target for [55 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) / 100]. This effect can only occur once every few seconds. 9 charges. Lasts 10 min. Earth Shield can only be placed on one target at a time and only one Elemental Shield can be active on a target at a time."},
[409951] = {name = "Spirit of the Alpha", additional_info = "[q]Gain the Spirit of the Alpha ability:\n\n\nInfuses the target with the spirit of an alpha wolf, increasing all threat generated by the target by 45% for 30 min. Limit 1 target. If cast on a target other than self, the Shaman also gains Loyal Beta, increasing Physical damage done by 5% and reducing all threat generated by 30% for 30 min. A target cannot have both Spirit of the Alpha and Loyal Beta at the same time."},
[409952] = {name = "Lava Burst", additional_info = "[q]Gain the Lava Burst ability:\n\n\nYou hurl molten lava at the target, dealing [469 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] to [605 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] Fire damage. If your Flame Shock is on the target, Lava Burst will deal a critical strike."},
[409953] = {name = "Lava Lash", additional_info = "[q]Gain the Lava Lash ability:\n\n\nYou charge your off-hand weapon with lava, instantly dealing 100% off-hand Weapon damage. Damage is increased by 125% if your off-hand weapon is enchanted with Flametongue."},
[409954] = {name = "Riptide", additional_info = "[q]Gain the Riptide ability:\n\n\nHeals a friendly target for [113 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] to [123 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] and another [5 * 24 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] over 15 sec. Your next Chain Heal cast on that primary target within 15 sec will consume the healing over time effect and increase the amount of the Chain Heal by 25%. This spell also triggers Ancestral Awakening."},
[409955] = {name = "Way of Earth", additional_info = "[q]Gain the Way of Earth ability:\n\n\nWhile Rockbiter Weapon is active on your main hand weapon and you have a shield equipped, you deal 50% increased threat, gain 30% increased health, take 10% reduced damage, gain 6% reduced chance to be critically hit by melee attacks, and Earth Shock taunts targets to attack you and has a separate cooldown from other Shock spells but has its range reduced to melee range."},
[409957] = {name = "Steady Shot", additional_info = "[q]Gain the Steady Shot ability:\n\n\nA steady shot that causes 100% ranged weapon damage."},
[409958] = {name = "Master Marksman", additional_info = "[q]Gain the Master Marksman ability:\n\n\nIncreases your critical strike chance by 5%, and reduces the Mana cost of all your Shot abilities by 25%."},
[409959] = {name = "Expose Weakness", additional_info = "[q]Gain the Expose Weakness ability:\n\n\nYour melee and ranged criticals increase your attack power by 40% of your current Agility for 7 sec."},
[409960] = {name = "Heart of the Lion", additional_info = "[q]Gain the Heart of the Lion ability:\n\n\nThe hunter invokes the heart of a lion, increasing total stats by 10% for all nearby allies, and increasing total stats for the Hunter by an additional 10%."},
[409961] = {name = "Dual Wield Specialization", additional_info = "[q]Gain the Dual Wield Specialist ability:\n\n\nIncreases the damage done by your offhand weapon by 50% and causes your Raptor Strike to strike with both weapons when you are dual-wielding."},
[409962] = {name = "Beast Mastery", additional_info = "[q]Gain the Beast Mastery ability:\n\n\nYour pet's damage and health are increased by 10%, and its Focus regeneration by 50%. In addition, your pet's Growl now also Taunts the target to attack it for 3 sec."},
[409963] = {name = "Summon Spirit", additional_info = nil},
[409968] = {name = "Trap Launcher", additional_info = "[q]Gain the Trap Launcher ability:\n\n\nYour Traps can now be placed at any location within 35 yards, and can be placed while you are in combat. Additionally, your Fire-based and Frost-based traps now have separate shared cooldowns."},
[409974] = {name = "Kill Command", additional_info = "[q]Gain the Kill Command ability:\n\n\nGive the command to kill, increasing your pet's damage done from Claw and Bite by 60% for 30 sec. Each Claw or Bite done by the pet reduces the damage bonus by 20%."},
[409976] = {name = "Chimera Shot", additional_info = "[q]Gain the Chimera Shot ability:\n\n\n You deal 135% weapon damage, refreshing the current Sting on your target and triggering an effect:\n\n Serpent Sting - Instantly deals 48% of the damage done by your Serpent Sting.\n\n Viper Sting - Instantly restores mana to you equal to 60% of the total amount drained by your Viper Sting.\n\n Scorpid Sting - Attempts to Disarm the target for 10 sec. This effect cannot occur more than once per 1 minute."},
[409978] = {name = "Explosive Shot", additional_info = "[q]Gain the Explosive Shot ability:\n\n\nYou fire an explosive charge into the enemy target, dealing [Ranged attack power * 0.039 + 62 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)]-[Ranged attack power * 0.039 + 94 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] Fire damage to all enemies within 8 yards. The charge will deal damage again every second for an additional 2 sec."},
[409979] = {name = "Lone Wolf", additional_info = "[q]Gain the Lone Wolf ability:\n\n\nYou deal 30% increased damage with all attacks while you do not have an active pet."},
[409988] = {name = "Force Player Cast Delayed Banish", additional_info = nil},
[409999] = {name = "Engrave Gloves - Beacon of Light", additional_info = "3 sec cast\nRequires Gloves\n[q]Engrave your gloves with the Beacon of Light rune:\n\n\nThe target becomes a Beacon of Light to all members of your party or raid within a 40 yard radius. Any heals you cast on party or raid members will also heal the Beacon for 100% of the amount healed. Only one target can be the Beacon of Light at a time. Lasts 1 min."},
[410001] = {name = "Engrave Gloves - Hand of Reckoning", additional_info = "3 sec cast\nRequires Gloves\n[q]Engrave your gloves with the Hand of Reckoning rune:\n\n\nTaunts the target to attack you, but has no effect if the target is already attacking you.\n\n While you know this ability, the threat bonus from Righteous Fury is increased to 80% and Righteous Fury causes you to gain mana when healed by others equal to 25% of the amount healed. Additionally, while Righteous Fury is active, damage which takes you below 35% health is reduced by 20%. Righteous Fury will remain active until cancelled."},
[410002] = {name = "Engrave Gloves - Crusader Strike", additional_info = "3 sec cast\nRequires Gloves\n[q]Engrave your gloves with the Crusader Strike rune:\n\n\nAn instant strike that causes 75% weapon damage as Holy and regenerates 5% of your maximum mana. The duration of all Judgement effects on the target is refreshed to 30 sec."},
[410008] = {name = "Engrave Pants - Avenger's Shield", additional_info = "3 sec cast\nRequires Pants\n[q]Engrave your pants with the Avenger's Shield rune:\n\n\nHurls a holy shield at the enemy, dealing [366 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] to [448 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] Holy damage, Dazing them and then jumping to additional nearby enemies. Affects 3 total targets. Lasts 10 sec."},
[410010] = {name = "Engrave Pants - Divine Sacrifice", additional_info = "3 sec cast\nRequires Pants\n[q]Engrave your pants with the Divine Sacrifice rune:\n\n\n30% of all damage taken by party members within 30 yards is redirected to the Paladin for 10 sec. Damage which reduces the Paladin below 20% health will break the effect and grant the paladin 10% increased damage and healing done for 10 sec. Divine Sacrifice cannot be used while you are under the effects of Blessing of Protection, Divine Shield, or Divine Protection, and prevents you from being targeted by those abilities while it is active."},
[410011] = {name = "Engrave Pants - Inspiration Exemplar", additional_info = "3 sec cast\nRequires Pants\n[q]Engrave your pants with the Inspiration Exemplar rune:\n\n\nYour inspiring presence periodically dispels Fear and Sleep effects on nearby party members."},
[410013] = {name = "Engrave Bracers - Hammer of the Righteous", additional_info = "3 sec cast\nRequires Bracers\n[q]Engrave your bracers with the Hammer of the Righteous rune:\n\n\nHammer the current target and up to 2 additional nearby targets, causing 4 times your main hand damage per second as Holy damage."},
[410014] = {name = "Engrave Chest - Divine Storm", additional_info = "3 sec cast\nRequires Chest, Chest\n[q]Engrave your chest with the Divine Storm rune:\n\n\nAn instant weapon attack that causes 110% of weapon damage to up to 4 enemies within 8 yards. The Divine Storm heals up to 3 party or raid members totaling 25% of the damage caused."},
[410015] = {name = "Engrave Chest - Seal of Martyrdom", additional_info = "3 sec cast\nRequires Chest, Chest\n[q]Engrave your chest with the Seal of Martyrdom rune:\n\n\nFills you with holy spirit for 30 sec, causing each of your melee attacks to deal 50% weapon damage to your target, but you lose health equal to 10% of the damage inflicted. While this seal is active, your party and raid members within 40 yards each gain mana equal to 133% of damage you take from this seal.\n\n Unleashing this Seal's energy will judge an enemy, instantly causing 85% weapon damage at the cost of health equal to 10% of the damage inflicted.\n\n This ability's Seal and Judgement benefit from talents and effects that modify the Seal or Judgement of Seal of Righteousness."},
[410021] = {name = "Engrave Chest - Wild Strikes", additional_info = "3 sec cast\nRequires Chest, Chest\n[q]Engrave your chest or robe with the Wild Strikes rune:\n\n\nWhile you are in Cat Form, Bear Form, or Dire Bear Form, party members within 20 yards gain increased combat ferocity. Each melee hit has a 20% chance of granting the attacker an extra attack with 20% additional Attack Power. No effect if the party member is already benefitting from Windfury Totem."},
[410023] = {name = "Engrave Pants - Savage Roar", additional_info = "3 sec cast\nRequires Pants\n[q]Engrave your pants with the Savage Roar rune:\n\n\nFinishing move that increases physical damage done by 30% while in Cat Form. Lasts longer per combo point:\n 1 point : 14 seconds\n 2 points: 19 seconds\n 3 points: 24 seconds\n 4 points: 29 seconds\n 5 points: 34 seconds"},
[410025] = {name = "Engrave Gloves - Mangle", additional_info = "3 sec cast\nRequires Gloves\n[q]Engrave your gloves with the Mangle rune:\n\n\nMangle the target for 160% normal damage and cause the target to take 30% additional damage from Bleed effects and Shred for 1 min. This ability benefits from and triggers all effects associated with Claw and Maul."},
[410027] = {name = "Engrave Boots - Survival Instincts", additional_info = "3 sec cast\nRequires Boots\n[q]Engrave your boots with the Survival Instincts rune:\n\n\nWhen activated, this grants you 30% of your maximum health for 20 sec. After the effect expires, the health is lost. Useable in any form.\n\n In addition, you regenerate 5 rage every time you dodge while in Bear Form or Dire Bear Form, 10 energy while in Cat Form, or 1% of your maximum mana while in any other form."},
[410028] = {name = "Engrave Gloves - Wild Growth", additional_info = "3 sec cast\nRequires Gloves\n[q]Engrave your gloves with the Wild Growth rune:\n\n\nHeals all of target player's party members within 40 yards of target player for [34 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] over 7 sec. The amount healed is applied quickly at first, and slows down as Wild Growth reaches its full duration."},
[410029] = {name = "Engrave Belt - Eclipse", additional_info = "3 sec cast\nRequires Belt\n[q]Engrave your belt with the Eclipse rune:\n\n\nStarfire increases the critical strike chance of your next two Wraths by 30%, and Wrath reduces the cast time of your next Starfire by 1.0 sec, both effects stacking up to 4 charges. Both spells also gain 70% chance at all times to not lose casting time when you take damage."},
[410033] = {name = "Engrave Pants - Lifebloom", additional_info = "3 sec cast\nRequires Pants\n[q]Engrave your pants with the Lifebloom rune:\n\nReduces the global cooldown on your Rejuvenation and Lifebloom abilities by 0.5 sec and you gain the Lifebloom ability:\n\n\nHeals the target for [4 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] over 7 sec. When Lifebloom completes its duration or is dispelled, the target instantly heals for [57 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] and the Druid regains half the cost of the spell. This effect can stack up to 3 times on the same target."},
[410059] = {name = "Engrave Belt - Nourish", additional_info = "3 sec cast\nRequires Belt\n[q]Engrave your belt with the Nourish rune:\n\n\nHeals a friendly target for [161 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] to [189 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)]. Heals for an additional 20% if you have a Rejuvenation, Regrowth, Lifebloom, or Wild Growth effect active on the target. This spell benefits from and triggers all effects associated with Healing Touch."},
[410060] = {name = "Engrave Boots - Dreamstate", additional_info = "3 sec cast\nRequires Boots\n[q]Engrave your boots with the Dreamstate rune:\n\n\nYour damaging spell critical strikes grant you 50% of your mana regeneration while casting for 8 sec and increase Nature damage dealt to the target by 20% for 12 sec."},
[410061] = {name = "Engrave Chest - Fury of Stormrage", additional_info = "3 sec cast\nRequires Chest, Chest\n[q]Engrave your chest or robe with the Fury of Stormrage rune:\n\n\nReduces the mana cost of Wrath by 100% and each time you deal damage with Wrath you have a 12% chance for your next cast of Healing Touch within 15 sec to be instant and castable in any shapeshift form."},
[410093] = {name = "Engrave Belt - Fire Nova", additional_info = "3 sec cast\nRequires Belt\n[q]Engrave your belt with the Fire Nova rune:\n\n\nYour Fire Nova Totem spell is replaced with Fire Nova, which causes your current Fire totem to emit damage at its location."},
[410094] = {name = "Engrave Chest - Overload", additional_info = "3 sec cast\nRequires Chest, Chest\n[q]Engrave your chest or robe with the Overload rune:\n\n\nGives your Lightning Bolt, Chain Lightning, Chain Heal, Healing Wave, and Lava Burst spells a 50% chance to cast a second, similar spell on the same target at no additional cost that causes half damage or healing and no threat."},
[410095] = {name = "Engrave Gloves - Lava Burst", additional_info = "3 sec cast\nRequires Gloves\n[q]Engrave your gloves with the Lava Burst rune:\n\n\nYou hurl molten lava at the target, dealing [469 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] to [605 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] Fire damage. If your Flame Shock is on the target, Lava Burst will deal a critical strike."},
[410096] = {name = "Engrave Chest - Dual Wield Specialization", additional_info = "3 sec cast\nRequires Chest, Chest\n[q]Engrave your chest or robe with the Dual Wield Specialization rune:\n\n\nIncreases your chance to hit with both spells and melee attacks by 10% while dual wielding, your Stormstrike ability now hits with both weapons while dual wielding, and increases the damage done by your offhand weapon by 50%."},
[410097] = {name = "Engrave Gloves - Water Shield", additional_info = "3 sec cast\nRequires Gloves\n[q]Engrave your gloves with the Water Shield rune:\n\n\nThe caster is surrounded by 3 globes of water, granting 1% of your maximum mana per 5 sec. When a spell, melee or ranged attack hits the caster, 4% of maximum mana is restored to the caster. This expends one water globe. Only one globe will activate every few seconds. Lasts 10 min. Only one Elemental Shield can be active on the Shaman at any one time."},
