[415729] = {name = "Enlightenment", additional_info = "[q]Gain the Enlightenment ability:\n\n\nYou deal 10% more damage while you have more than 70% mana. While below 30% mana 10% of your mana regeneration continues while casting."},
[415734] = {name = "Spellfrost Bolt", additional_info = "[q]Gain the Spellfrost Bolt ability:\n\n\nLaunches a bolt of spellfrost at the enemy, causing [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 305 / 100 * ( 1 ) ] to [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 355 / 100 * ( 1 ) ] Spellfrost damage and slowing movement speed by 40% for 9 sec. This spell will be checked against the lower of the target's Frost and Arcane resists and counts as both Frost and Arcane damage."},
[415737] = {name = "Serendipity", additional_info = "[q]Gain the Serendipity ability:\n\n\nHealing with Flash Heal reduces the cast time of your next Lesser Heal, Heal, Greater Heal, or Prayer of Healing by 20% for 20 sec, stacking up to 3 times."},
[415738] = {name = "Mind Sear", additional_info = "[q]Gain the Mind Sear ability:\n\n\nCauses an explosion of shadow magic around the enemy target, causing [70 / 100 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60)] to [78 / 100 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60)] Shadow damage every 1 sec for 5 sec to all enemies within 10 yards around the target."},
[415739] = {name = "Strength of Soul", additional_info = "[q]Lesser Heal, Heal, Greater Heal, and Flash Heal reduce the remaining duration of Weakened Soul on targets they heal by 4 sec. In addition, targets of your Power Word: Shield will gain Rage from taking damage despite the damage being absorbed, and Righteous Fury will trigger from damage absorbed by your Power Word: Shield as if it were a heal."},
[415740] = {name = "Strength of Soul", additional_info = "[q]Gain the Strength of Soul ability:\n\n\nLesser Heal, Heal, Greater Heal, and Flash Heal reduce the remaining duration of Weakened Soul on targets they heal by 4 sec. In addition, targets of your Power Word: Shield will gain Rage from taking damage despite the damage being absorbed, and Righteous Fury will trigger from damage absorbed by your Power Word: Shield as if it were a heal."},
[415743] = {name = "Blood Surge", additional_info = "[q]Gain the Blood Surge ability:\n\n\nHeroic Strike, Bloodthirst, and Whirlwind have a 30% chance to make your next Slam within 15 sec instant and cost no Rage."},
[415744] = {name = "Precise Timing", additional_info = "[q]Gain the Precision Timing ability:\n\n\nSlam is now instant but has a 6 sec cooldown."},
[415745] = {name = "Focused Rage", additional_info = "[q]Gain the Focused Rage ability:\n\n\nReduces the rage cost of your offensive abilities by 3."},
[415749] = {name = "Demonic Knowledge", additional_info = "[q]Gain the Demonic Knowledge ability:\n\n\nIncreases your spell damage and healing by a value equal to 10% of your Demon pet's total Stamina plus Intellect."},
[415750] = {name = "Incinerate", additional_info = "[q]Gain the Incinerate ability:\n\n\nBurn your enemy for [222 / 100 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60)] to [258 / 100 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60)] damage and increase all Fire damage you deal by 25% for the next 15 sec."},
[415751] = {name = "Dance of the Wicked", additional_info = "[q]Gain the Dance of the Wicked ability:\n\n\nYou and your demon pet gain dodge chance equal to your spell critical strike chance each time you deal a critical strike to an enemy, and also both regain 2% of maximum mana."},
[415755] = {name = "Guarded by the Light", additional_info = "[q]Gain the Guarded by the Light ability:\n\n\nEach time you hit a target with your melee weapon, you gain 5% of your maximum mana per 3 sec for 15 sec, but the amount healed by your Flash of Light, Holy Light, and Holy Shock spells is reduced by 50% during this mana regeneration."},
[415756] = {name = "Exorcist", additional_info = "[q]Gain the Exorcist ability:\n\n\nExorcism can now be cast on any target and has 100% increased critical strike chance against Undead and Demons."},
[415759] = {name = "Skull Bash", additional_info = "[q]Gain the Skull Bash ability:\n\n\nCharge to a target within 13 yards and bash the target's skull, interrupting spellcasting and preventing any spell in that school from being cast for 2 sec. Shares a cooldown with Feral Charge."},
[415760] = {name = "Lacerate", additional_info = "[q]Gain the Lacerate ability:\n\n\nLacerates the enemy target, making them bleed for [(9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) * 20 / 100 * 5] damage over 15 sec plus 20% weapon damage per existing application of Lacerate on the target. Causes a high amount of threat. This effect stacks up to 5 times on the same target."},
[415761] = {name = "Living Seed", additional_info = "[q]Gain the Living Seed ability:\n\n\nWhen you critically heal your target with any non-periodic healing spell you plant a Living Seed on the target for 50% of the amount healed. The Living Seed will bloom the next time the target takes damage or receives non-periodic healing. Lasts 15 sec."},
[415762] = {name = "Elune's Fires", additional_info = "[q]Gain the Elune's Fires ability:\n\n\nSome of your spells and abilities extend the duration of your damage and healing over time effects on their target:\n\n Starfire extends Moonfire by 6 sec.\n Wrath extends Sunfire by 3 sec.\n Regrowth extends Rejuvenation by 6 sec.\n Shred extends Rip by 2 sec.\n\n Each effect can only be extended up to 3 times."},
[415768] = {name = "Burn", additional_info = "[q]Gain the Burn ability:\n\n\nYour Flame Shock now strikes up to 5 targets, gains 6 sec increased duration, and deals 100% increased damage. In addition, while you have Flametongue Weapon imbued on an equipped weapon, you gain (4 * 60) increased spell damage."},
[415816] = {name = "Invigoration", additional_info = "[q]Gain the Invigoration ability:\n\n\nWhen your pet scores a critical hit with a special ability, you instantly regenerate 5% of your maximum mana."},
[415817] = {name = "Rapid Killing", additional_info = "[q]Gain the Rapid Killing ability:\n\n\nReduces the cooldown on Rapid Fire by 80%, and your next Shot ability within 20 sec after killing a target worth experience or honor deals 20% increased damage."},
[415818] = {name = "Sniper Training", additional_info = "[q]Gain the Sniper Training ability:\n\n\nYour Shot abilities gain 2% increased critical strike chance while you have not moved for the last 2 sec, stacking every sec up to 5 times. At 5 stacks, your Aimed Shot becomes instant. While moving, you will lose 1 stack per sec."},
[415822] = {name = "Raptor Fury", additional_info = "[q]Gain the Raptor Fury ability:\n\n\nRaptor Strike increases damage done by Raptor Strike and Mongoose Bite by 10% for 15 sec, stacking up to 5 times. Subsequent doses do not extend the duration of this effect."},
[415926] = {name = "Engrave Boots - Waylay", additional_info = "3 sec cast\nRequires Boots\n[q]Engrave your boots with the Waylay rune:\n\n\nYour Ambush and Backstab hits unbalance your target, increasing the time between their melee attacks by 10%, and reducing movement speed by 50% for 8 sec."},
[415934] = {name = "Engrave Boots - Spell Power", additional_info = "3 sec cast\nRequires Boots\n[q]Engrave your boots with the Spell Power rune:\n\n\nIncreases critical strike damage bonus of all spells by 50%."},
[415936] = {name = "Engrave Gloves - Living Bomb", additional_info = "3 sec cast\nRequires Gloves\n[q]Engrave your gloves with the Living Bomb rune:\n\n\nThe target becomes a Living Bomb, taking [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 85 / 100 * 4] Fire damage over 12 sec. After 12 sec or when the spell is dispelled, the target explodes dealing [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 171 / 100] Fire damage to all enemies within 10 yards"},
[415939] = {name = "Engrave Pants - Mass Regeneration", additional_info = "3 sec cast\nRequires Pants\n[q]Engrave your pants with the Mass Regeneration rune:\n\n\nHeals all of target player's party members within 30 yards of target player for [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 42 / 100 * 3] health over 3 sec and applies Temporal Beacon to each target for 15 sec.\n\n Temporal Beacon\n\nRecords the subject's space-time position. 80% of all Arcane damage done by the caster will be converted to chronomantic healing on each of the caster's current Temporal Beacon targets. This healing is reduced by 50% on self, and also reduced by 80% when damage is done by Arcane spells that damage multiple targets."},
[415942] = {name = "Engrave Chest - Enlightenment", additional_info = "3 sec cast\nRequires Chest, Chest\n[q]Engrave your chest or robe with the Enlightenment rune:\n\n\nYou deal 10% more damage while you have more than 70% mana. While below 30% mana 10% of your mana regeneration continues while casting."},
