[416014] = {name = "Engrave Boots - Demonic Knowledge", additional_info = "3 sec cast\nRequires Boots\n[q]Engrave your boots with the Demonic Knowledge rune:\n\n\nIncreases your spell damage and healing by a value equal to 10% of your Demon pet's total Stamina plus Intellect."},
