[435949] = {name = "[q4]Glowing Hyperconductive Scale Coif", additional_info = "45 sec cast\nReagents:\nLow-Background Truesilver Plates , Thick Murloc Scale (10), Faintly Glowing Leather (5), Insulating Gniodine\n[q4]Glowing Hyperconductive Scale Coif\nBinds when picked up\nHead Mail\n242 Armor\n+14 Stamina\n+15 Intellect\nDurability 85 / 85\n40\nRequiresLeatherworking\n(225)\n[q2]Equip: Increases damage and healing done by magical spells and effects by up to 21.\n[q2]Use: Inflicts hyperconductive shock, instantly dealing 312 to 688 damage to yourself but also increasing your spell casting speed by 20% for 10 sec. (10 Min Cooldown)"},
