[435951] = {name = "[q4]Gneuro-Conductive Channeler's Hood", additional_info = "45 sec cast\nReagents:\nInsulating Gniodine , Cured Thick Hide (5), Faintly Glowing Leather (5), Hyperconductive Arcano-Filament\n[q4]Gneuro-Conductive Channeler's Hood\nBinds when picked up\nHead Leather\n118 Armor\n+11 Stamina\n+12 Intellect\n+11 Spirit\nDurability 70 / 70\n40\nRequiresLeatherworking\n(225)\n[q2]Equip: Increases damage and healing done by magical spells and effects by up to 21.\n[q2]Use: Gain gneuromantic meditation, allowing 100% of your mana regeneration to continue while casting and increasing damage and healing done by spells by up to 50 for 20 sec. (10 Min Cooldown)"},
[435952] = {name = "Pattern: Gneuro-Conductive Channeler's Hood", additional_info = "100 yd range\n3 sec cast\n[q]Teaches you how to craft a Gneuro-Conductive Channeler's Hood."},
[435953] = {name = "[q4]Rad-Resistant Scale Hood", additional_info = "45 sec cast\nReagents:\nLow-Background Truesilver Plates , Cured Thick Hide (5), Faintly Glowing Leather (5), Insulating Gniodine\n[q4]Rad-Resistant Scale Hood\nBinds when picked up\nHead Mail\n[q2]342 Armor\n+10 Stamina\n+10 Intellect\nDurability 85 / 85\n40\nRequiresLeatherworking\n(225)\n[q2]Equip: Improves your chance to hit with all spells and attacks by 1%.\n[q2]Equip: +32 Attack Power.\n[q2]Use: Engage the radiation mitigation protocols in this helmet, causing you to immediately remove all active poison effects and gain immunity to all Nature damage for 3 sec. (10 Min Cooldown)"},
