[435956] = {name = "[q3]Polished Truesilver Gears", additional_info = "8 sec cast\nTools:\nBlacksmith Hammer\nReagents:\nTruesilver Bar , Pile of Tarnished Gears (5)\n[q3]Polished Truesilver Gears"},
