[435958] = {name = "[q4]Whirling Truesilver Gearwall", additional_info = "45 sec cast\nTools:\nBlacksmith Hammer\nReagents:\nLow-Background Truesilver Plates (3), Polished Truesilver Gears (5), Faintly Glowing Leather (2), Mithril Casing (2), Gyrochronatom (2), Mithril Bar (15)\n[q4]Whirling Truesilver Gearwall\nBinds when picked up\nOff Hand Shield\n1760 Armor\n29 Block\n+9 Strength\n+10 Stamina\nDurability 120 / 120\n40\nRequiresEngineering\n(225)\n[q2]Equip: Increases your chance to block attacks with a shield by 1%.\n[q2]Equip: On a successful block the whirling razor-sharp gears on this shield inflict 5 to 10 physical damage to the attacker and 2 to 10 physical damage to the bearer.\n[q]\"The rotating edges on this shield are surprisingly sharp. This seems just as dangerous for the bearer as it is to the attacker.\""},
