[435960] = {name = "[q4]Hyperconductive Goldwap", additional_info = "45 sec cast\nTools:\nArclight Spanner\nReagents:\nPolished Truesilver Gears (3), Hyperconductive Arcano-Filament (3), Faintly Glowing Leather , Gold Bar (10)\n[q4]Hyperconductive Goldwrap\nBinds when picked up\nWaist Cloth\n40 Armor\n+9 Stamina\nDurability 35 / 35\n40\nRequiresEngineering\n(225)\n[q2]Equip: Improves your chance to get a critical strike with all spells and attacks by 1%.\n[q2]Equip: Improves your chance to hit with all spells and attacks by 1%.\n[q2]Use: Pull a hyperconductive coin from your belt and flip it. Heads: gain 3% increased critical strike chance with all spells and attacks for 30 sec. Tails: gain 10% movement speed for 30 sec. (15 Min Cooldown)\n[q]\"This belt clinks faintly as you move.\""},
