[446179] = {name = "[q4]Shoulderplates of Dread", additional_info = "45 sec cast\nTools:\nBlacksmith Hammer\nReagents:\nNightmare Seed (10), Inert Mantle of Nightmares\n[q4]Shoulderplates of Dread\nBinds when picked up\nShoulder Plate\n472 Armor\n+12 Strength\n+12 Agility\n+12 Stamina\nDurability 100 / 100\n50\nRequiresBlacksmithing\n(250)\n[q2]Equip: Improves your chance to hit with all spells and attacks by 1%.\n[q2]Equip: Melee attacks have a chance to increase your attack speed by 5% and attack power by 50 for 10 sec. This has no effect outside of areas under the influence of the Nightmare. (Proc chance: 30%, 40s cooldown)"},
