[446188] = {name = "[q4]Fearmonger's Shoulderguards", additional_info = "45 sec cast\nTools:\nBlacksmith Hammer\nReagents:\nNightmare Seed (10), Inert Mantle of Nightmares\n[q4]Fearmonger's Shoulderguards\nBinds when picked up\nShoulder Plate\n472 Armor\n+10 Intellect\nDurability 100 / 100\n50\nRequiresBlacksmithing\n(250)\n[q2]Equip: Improves your chance to get a critical strike with all spells and attacks by 1%.\n[q2]Equip: Increases damage done by Holy spells and effects by up to 24.\n[q2]Equip: Melee attacks and harmful spells have a chance to increase spell damage by up to 50 for 10 sec. This has no effect outside of areas under the influence of the Nightmare. (Proc chance: 30%, 40s cooldown)"},
