[446236] = {name = "[q4]Void-Powered Invoker's Vambraces", additional_info = "45 sec cast\nTools:\nArclight Spanner\nReagents:\nNightmare Seed (10), Inert Mantle of Nightmares , Void-Powered Vambraces , Gold Power Core (2), Thorium Widget (2)\n[q4]Void-Powered Invoker's Vambraces\nBinds when picked up\nWrist Cloth\n37 Armor\n+7 Stamina\n+8 Intellect\nDurability 35 / 35\n50\nRequiresEngineering\n(250)\n[q2]Equip: Increases damage and healing done by magical spells and effects by up to 21.\n[q2]Equip: Provides protection against certain types of psychic attacks.\n[q2]Use: Channels the power of the Void, granting immunity to Fear for 15 sec. (10 Min Cooldown)\n[q]\"All of the best parts about Ziri's original design, with a few additional modifications.\""},
